import { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);
  const getUsers = async () => {
    const { data } = await axios.get('https://api.pokemontcg.io/v2/cards?page=1&pageSize=10');
    setData(data.data);
    console.log('....', data.data);
  }

  useEffect(() => {
    getUsers();
  }, []);
  if (data) {
    // console.log('...', data.data);
  }
  return (
    <div className="App">

      {
        data.map((user) => {
          return (
            <div key={user.id}>
              <img src={user.images.large} alt="pokemon" />
              <h1>{user.name}</h1>
              { user.attacks.map((item, acc) => {
                return item.name;
              }).join(', ')}
              <h3>{user.hp}</h3>
            </div>
          )
        })
      }
    </div>
  );
}

export default App;
